import Element from './Element'
import './Timeline.css'

import amazonLogo from '../../images/companies/amazon_logo.png'
import feupLogo from '../../images/companies/feup_logo.png'

function Timeline() {
  return (
    <>
      <div className='timeline'></div>
      <Element side='left' logo={feupLogo} role='MSc Degree' company='FEUP' startDate='September 2016' endDate='December 2020'/>
      <Element side='right' logo={amazonLogo} role='Intern' company='Amazon' startDate='February 2020' endDate='November 2020'/>
    </>
  )
}

export default Timeline;
